import coverImage from "../assets/images/coverImage.jpg";
import styles from "../assets/AboutSection.module.css";

function AboutSection() {
  return (
    <div className={styles.generalContainer}>
      <div className={styles.sectionContainer}>
        <div className={styles.imageContainer}>
          <img src={coverImage} alt="Cover" className={styles.image} />
        </div>
        <div className={styles.textContainer}>
          <p>
            Nostrud veniam reprehenderit sunt deserunt excepteur elit tempor
            Lorem in sit cillum. Irure in ullamco in ea amet sint deserunt
            labore. Cillum qui incididunt mollit consequat deserunt ullamco
            excepteur eiusmod minim laborum. Laboris est elit est exercitation
            adipisicing. Dolore excepteur dolor dolor occaecat ut. Deserunt
            proident sunt aliqua consequat pariatur aliqua nostrud velit.
          </p>
        </div>
      </div>
    </div>
  );
}

export default AboutSection;
